$(document).ready(function(){

	// Load main page.
	$(".main").click(function() {
  		window.location.href = "index.html";
	});
	
	// Save worldcup subject.
	var worldcupSubject = localStorage.getItem('buttonId'); // Get subject
	
	if(worldcupSubject == "subject") worldcupSubject = subject;
	else if(worldcupSubject == "cafe") worldcupSubject = cafe;
	else if(worldcupSubject == "place") worldcupSubject = place;
	
	var title = worldcupSubject.title;
	var top8 = worldcupSubject.data;
	
	// Shuffle the candidates.
	for (let i = top8.length - 1; i > 0; i--) {
	    let j = Math.floor(Math.random() * (i + 1));
	    [top8[i], top8[j]] = [top8[j], top8[i]];
	}
	
	var top4 = [];
	
	$(".worldcup-subject").text(title);
	// Start worldcup.
	startWorldcup(top8, top4, 0);
	
	// The winner is selected through a tournament.
	function startWorldcup(candidates, nextRoundCandidates, index, totalMatches = null) {
	    if (totalMatches === null) {
	        totalMatches = Math.pow(2, Math.log2(candidates.length) - 1);
	    }
    	console.log(totalMatches);
    	
	    if (candidates.length == 1) {
	        localStorage.setItem('winnerSubject', title);
	        localStorage.setItem('winnerImage', candidates[0][1]);
	        localStorage.setItem('winnerName', candidates[0][0]);
	        window.location.href = "winner.html";
	        return;
	    }
	    
	    if (index >= candidates.length) {
	        console.log(nextRoundCandidates);
	        startWorldcup(nextRoundCandidates, [], 0);
	    } else {
			var matchNumber = index / 2 + 1;
     	   	switch (totalMatches) {
	            case 4:
	                roundName = "Quarter-Final Round";
	                break;
	            case 2:
	                roundName = "Semi-Final Round";
	                break;
	            case 1:
	                roundName = "Final Round";
	                break;
	            default:
	                roundName = "Round of " + totalMatches * 2;
	                break;
	        }
        	updateStatus(roundName, matchNumber, totalMatches);
        	
	        injectCandidates(candidates[index][1], candidates[index+1][1], candidates[index][0], candidates[index+1][0]);
	
	        $("#i1").off('click').on('click', function() {
	            nextRoundCandidates.push(candidates[index]);
	            startWorldcup(candidates, nextRoundCandidates, index + 2);
	        });
	        $("#i2").off('click').on('click', function() {
	            nextRoundCandidates.push(candidates[index+1]);
	            startWorldcup(candidates, nextRoundCandidates, index + 2);
	        });
	    }
	}
	
	// Update image and text of candidates.
	function injectCandidates(i1, i2, t1, t2){
		$("#i1").attr("src", i1);
		$("#i2").attr("src", i2);
		$("#t1").text(t1);
		$("#t2").text(t2);
	}
	
	// Update info of round.
	function updateStatus(roundName, current, total) {
	    $(".worldcup-status-text").text(roundName + " " + current + " / " + total);
	}
	
});
